import '../App.css';
import React from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import img1 from '../img/img.jpg'


function Service1() {
  return (

    <Card>
        <div className="col-md-6">
          <Card.Img variant="top" src={img1} alt="Imagen del servicio" />
        </div>
        <div className="col-md-6">
          <Card.Body>
            <Card.Title>Título del servicio</Card.Title>
            <Card.Subtitle className="mb-2 text-muted">Subtítulo del servicio</Card.Subtitle>
            <Card.Text>
              Aquí puedes agregar una descripción breve del servicio.
            </Card.Text>
            <ListGroup>
              <ListGroup.Item>Servicio 1</ListGroup.Item>
              <ListGroup.Item>Servicio 2</ListGroup.Item>
              <ListGroup.Item>Servicio 3</ListGroup.Item>
              {/* Agrega más elementos de la lista según sea necesario */}
            </ListGroup>
            <Button variant="primary">Ver más</Button>
          </Card.Body>
        </div>
    </Card>
  );
}

export default Service1;
